var twitterApp = (function () {
    var results = initResults(),
        total_pos = 0,
        total_neg = 0,
        POSITIVE = 1,
        NEGATIVE = 0,
        pieChart,
        self;

    function initResults() {
        return [{
            "label": "Negative",
            "value": 50
        }, {
            "label": "Positive",
            "value": 50
        }
        ];
    }


    function init(options) {
        self = this;
        console.log(options);
        showTrendingData();
        self.charting.createPieChart('#pie-chart', results, function (chart) {
            pieChart = chart;
        });
        searchPressed();
        self.charting.createWorldMap();
    }


    function searchPressed() {
        $('.search').find('button').click(function () {
            searchQuery();

        })
    }

    function searchQuery() {
        var $search = $('.search'),
            val = $search.find('input').val();
        total_neg = 0;
        total_pos = 0;
        setPieResult(POSITIVE, 50);
        setPieResult(NEGATIVE, 50);
        if (val && val !== '') {
            streamResults(val)
            $('#search-title').append(val);
        }
    }


    function onDataReceived(data) {
        if (data) {
            data.forEach(function (value) {
                var data = value.data,
                    result = data.result;
                if (result) {
                    console.log(data);
                    if (result === 1) {
                        total_pos++;
                        setPieResult(POSITIVE, total_pos);
                        self.charting.addResultToRegion(data.result, data.location);
                    } else {
                        total_neg++;
                        setPieResult(NEGATIVE, total_neg);
                    }
                }


            });

        }
    }

    function streamResults(query) {
        var codes = self.charting.getRegionCodes();
        codes.forEach(function (code) {
            queryAPI(query, code, onDataReceived);
        })

    }


    function queryAPI(query, code, onDataReceived) {
        var uri = '/linearsvc?q=' + query + "&code=" + code;
        return ajax_stream(uri, onDataReceived)
    }

    function showTrendingData() {
        return $.getJSON('/trending')
            .then(function (data) {
                var trending = data && data.trending ? data.trending : [];
                trending.forEach(function (hashtag) {
                    appendHashTag(hashtag);
                });

            })
    }


    function appendHashTag(hash) {
        var $trending = $('#trending-tags');
        $trending.append('<div class="trend">' + hash + '</div>');
    }


    function ajax_stream(uri, onDataReceived) {
        try {
            var xhr = new XMLHttpRequest();
            xhr.previous_text = '';

            xhr.onerror = function () {
                console.log("XHR Error");
            };
            xhr.onreadystatechange = function () {
                try {
                    if (xhr.readyState > 2) {
                        var response = xhr.responseText.substring(xhr.previous_text.length);
                        if (response.endsWith(",")) {
                            response = response.slice(0, -1);
                        }
                        if (response.startsWith(",")) {
                            response = response.slice(1);
                        }
                        var result = JSON.parse("[" + response + "]");
                        onDataReceived(result);
                        xhr.previous_text = xhr.responseText;
                    }
                }
                catch (e) {
                    console.log(e);
                }


            };
            xhr.open("GET", uri, true);
            xhr.send("Making request...");
        }
        catch (e) {
            log_message("<b>[XHR] Exception: " + e + "</b>");
        }
    }

    function setPieResult(index, value) {
        results[index].value = value
        pieChart.update();
    }

    var api = {
        init: init,
        setPieResult: setPieResult
    };
    return api;


})();
twitterApp.charting = (function () {
    var regionCodes = [],
        regionData = {},
        map;

    function createPieChart(elementSelector, results, listener) {
        var chart;
        nv.addGraph(function () {
            var width = 600,
                height = 400;
            chart = nv.models.pieChart()
                .x(function (d) {
                    return d.label
                })
                .y(function (d) {
                    return d.value
                })
                .showLabels(true)     //Display pie labels
                .labelThreshold(.05)  //Configure the minimum slice size for labels to show up
                .labelType("percent")
                .width(width)
                .height(height)
            d3.select(elementSelector)
                .datum(results)
                .transition().duration(350)
                .call(chart)
                .style({'width': width, 'height': height});
            nv.utils.windowResize(chart.update);

            listener(chart);

            return chart;
        });
    }

    function calcColor(percentage) {
        var colourPalette = ['#e51e00', '#e54c00', '#e57b00', '#e5a900',
                '#e5d700', '#c4e500', '#96e500', '#67e500', '#39e500', '#0ae600'],
            totalColors = colourPalette.length,
            color = Math.floor(totalColors * percentage) - 1;
        return colourPalette[color] ||  "#AEC7E8";

    }

    function recalculateColors() {
        var colors = {},
            key, data;

        for (key in map.regions) {
            data = regionData[key];
            var percentage = data.pos / data.tot;
            colors[key] = calcColor(percentage)
        }
        return colors;
    }

    function createWorldMap() {
        var key;
        map = new jvm.Map({
            map: 'us_aea',
            container: $('#worldmap'),
            hoverOpacity: 0.7,
            series: {
                regions: [{
                    attribute: 'fill'
                }]
            },
            regionStyle: {
                initial: {
                    fill: '#AEC7E8'
                }
            }
        });
        for (key in map.regions) {
            regionData[key] = {"pos": 0, "neg": 0, "tot": 0};
            regionCodes.push(key);
        }
    }

    function addResultToRegion(result, location) {
        var region = regionData[location];
        if (region) {
            if (result === 1) {
                region.pos += 1;
            } else {
                region.neg += 1;
            }
            region.tot++;

        }
        map.series.regions[0].setValues(recalculateColors());
    }

    var api = {
        createPieChart: createPieChart,
        createWorldMap: createWorldMap,
        getRegionCodes: function () {
            return regionCodes;
        },
        addResultToRegion: addResultToRegion

    }
    return api;
})();